import React from "react"
import NavigationButton from "./NavigationButton"

class Navigation extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      page: 0
    }

    this.handleChange = this.handleChange.bind(this)
    this.changePageValue2 = this.changePageValue2.bind(this)
  }
  handleChange(value) {
    this.props.changePageValue1(value)
    console.log(111)
  }
  changePageValue2(value) {
    handleChange(value)
    console.log(222)
  }



  render() {
    return (
    <nav className="navigation-container" >
      <NavigationButton key={0} page={0} changePageValue = {this.changePageValue2} />
      <NavigationButton key={1} page={1} />
      <NavigationButton key={2} page={2} />
      <NavigationButton key={3} page={3} />
    </nav>
    )
  }
}

export default Navigation
